import React from 'react';
import Cabecalho from './main/Header';
import { BrowserRouter } from 'react-router-dom'
import Logo from './main/Logo';


function App() {
  return (
    <BrowserRouter>
      <Logo />
      <Cabecalho/>
    </BrowserRouter>
  );
}

export default App;
